struct flatten_args {
    float axis;
};
void ee_Flatten(NumPyArray* A, NumPyArray* flatArray, flatten_args args) {
    int index = 0, index1 = 0;

    flatArray->shape[0] = 1;
    flatArray->shape[1] = 1;
    flatArray->shape[2] = 1;
    flatArray->shape[3] = A->size;
    flatArray->size = A->size;
    if (flatArray->data != nullptr)
        free(flatArray->data);
    flatArray->data = (int*)malloc(flatArray->size * sizeof(int));

    for (int i = 0; i < A->shape[0]; i++) {
        for (int j = 0; j < A->shape[1]; j++) {
            for (int k = 0; k < A->shape[2]; k++) {
                for (int l = 0; l < A->shape[3]; l++) {
                    flatArray->data[index++] = A->data[index1++];
                }
            }
        }
    }
}

void Flatten(DataPort *input0, DataPort *output0, flatten_args args) {
    ee_Flatten(input0->data, output0->data, { .axis=args.axis });
    return;
}

void calculate_scale_and_zero_point_4D(NumPyArray* array, float& scale, int8_t& zero_point) {
    if (array == nullptr || array->data == nullptr || array->size == 0) {
        std::cout << "Invalid NumPyArray: Cannot calculate scale and zero point.\n" << std::endl;
        return;
    }

    // Find the minimum and maximum values in the data
    int32_t min_vall = array->data[0];
    int32_t max_vall = array->data[0];

    for (int i = 0; i < array->size; ++i) {
        min_vall = std::min(min_vall, (array->data[i]));
        max_vall = std::max(max_vall, (array->data[i]));
    }

    float min_val = static_cast<float> (min_vall);
    float max_val = static_cast<float> (max_vall);

    scale = (max_val-min_val)/255.0f;
    zero_point = static_cast<int8_t>(std::round(-(min_val/scale)-128.0f));
}

