void Quantize(const float& scale, const int8_t& zero_point, const NumPyArray* src, QNumPyArray* dst) {
  if (!src || !src->data || src->size <= 0 || !dst || !dst->data) {
    throw std::invalid_argument("Invalid source or destination NumPyArray.");
  }
  
  dst->size = src->size;
  std::copy(std::begin(src->shape), std::end(src->shape), std::begin(dst->shape));

  for (int i = 0; i < src->size; i++) {
    const float real_val = static_cast<float>(src->data[i]);
    const float transformed_val = zero_point + (real_val / scale);
    const float clamped_val = std::max(-128.0f, std::min(127.0f, transformed_val));
    dst->data[i] = static_cast<int8_t>(std::round(clamped_val));
  }
}

void Dequantize(const float& scale, const int8_t& zero_point, const QNumPyArray* src, NumPyArray* dst) {
  if (!dst || !dst->data || !src || !src->data || src->size <= 0) {
    throw std::invalid_argument("Invalid destination NumPyArray or source QNumPyArray.");
  }

  if (dst->size < src->size) {
    throw std::out_of_range("Destination NumPyArray size is smaller than the source QNumPyArray.");
  }

  std::copy(std::begin(src->shape), std::end(src->shape), std::begin(dst->shape));
  dst->size = src->size;

  for (int i = 0; i < src->size; i++) {
    const int8_t quantized_val = src->data[i];
    dst->data[i] = static_cast<int>(scale * (quantized_val - zero_point));
  }
}



void QuantizeMultiplierSmallerThanOne(float real_multiplier,
                                      std::int32_t* quantized_multiplier,
                                      int* right_shift) {
  int s = 0;
  // We want to bring the real multiplier into the interval [1/2, 1).
  // We can do so by multiplying it by two, and recording how many times
  // we multiplied by two so that we can compensate that by a right
  // shift by the same amount.
  while (real_multiplier < 0.5f) {
    real_multiplier *= 2.0f;
    s++;
  }
  // Now that the real multiplier is in [1/2, 1), we convert it
  // into a fixed-point number.
  std::int64_t q =
      static_cast<std::int64_t>(std::round(real_multiplier * (1ll << 31)));
  // Handle the special case when the real multiplier was so close to 1
  // that its fixed-point approximation was undistinguishable from 1.
  // We handle this by dividing it by two, and remembering to decrement
  // the right shift amount.
  if (q == (1ll << 31)) {
    q /= 2;
    s--;
  }
  *quantized_multiplier = static_cast<std::int32_t>(q);
  *right_shift = s;
}

int32_t MultiplyByQuantizedMultiplier(int32_t x, int32_t quantized_multiplier, int shift) {
  const int64_t total_shift = 31 - shift;
  const int64_t round = static_cast<int64_t>(1) << (total_shift - 1);
  int64_t result = x * static_cast<int64_t>(quantized_multiplier) + round;
  result = result >> total_shift;

  result = std::clamp(
      result, static_cast<int64_t>(std::numeric_limits<int32_t>::min()),
      static_cast<int64_t>(std::numeric_limits<int32_t>::max()));
  return static_cast<int32_t>(result);
}

// Print matrix utility for debugging
void print_matrix(const char* name, NumPyArray* mat, int rows, int cols) {
    printf("%s:\n", name);
    for (int i = 0; i < rows; ++i) {
        for (int j = 0; j < cols; ++j) {
            printf("%4d ", mat->data[i * cols + j]);
        }
        printf("\n");
    }
}

struct gemm_args {
    float alpha;
    float beta;
    float transA;
    float transB;
};
// Helper function to get the index for transposed arrays
int getIndex(int i, int j, int rows, int cols, bool transpose)
{
    if (transpose) {
        return j * cols + i;
    }
    return i * cols + j;
}

void print_vector_as_matrix(const std::vector<int8_t>& vec, int M, int N) {
    for (int i = 0; i < M; ++i) {
        for (int j = 0; j < N; ++j) {
            std::cout << static_cast<int>(vec[i * N + j]) << " ";
        }
        std::cout << std::endl; // Move to the next row
    }
}

// Function to perform matrix multiplication (Gemm)
void ee_Gemm(NumPyArray* A, NumPyArray* B, NumPyArray* bias, NumPyArray* C, gemm_args args)
{
    int M = args.transA ? A->shape[3] : A->shape[2];
    int K = args.transA ? A->shape[2] : A->shape[3];
    int N = args.transB ? B->shape[2] : B->shape[3];
    
    C->shape[0] = A->shape[0];
    C->shape[1] = A->shape[1];
    C->shape[2] = M;
    C->shape[3] = N;
    C->size = C->shape[0] * C->shape[1] * C->shape[2] * C->shape[3];
    
    // printf("transA[%f], transB[%f]\n", args.transA, args.transB);
    // printf("M=%d, K=%d, N=%d\n", M, K, N);
    
    if (C->data != nullptr)
        free(C->data);
    C->data = (int*)calloc(C->size, sizeof(int));

    float scale_A,scale_B,scale_C=1.0f;
    int8_t zero_point_A,zero_point_B,zero_point_C=0;

    calculate_scale_and_zero_point_4D(A,scale_A,zero_point_A);
    calculate_scale_and_zero_point_4D(B,scale_B,zero_point_B);

    std::cout << "Scale A : " << scale_A << std::endl;
    std::cout << "Scale B : " << scale_B << std::endl;
    std::cout << "Zero Point A : " << static_cast<int>(zero_point_A) << std::endl;
    std::cout << "Zero Point B : " << static_cast<int>(zero_point_B) << std::endl;

    QNumPyArray* AA = createQNumPyArray(A->shape[0],A->shape[1],A->shape[2],A->shape[3]);
    QNumPyArray* BB = createQNumPyArray(B->shape[0],B->shape[1],B->shape[2],B->shape[3]);

    Quantize(scale_A,zero_point_A,A,AA);
    Quantize(scale_B,zero_point_B,B,BB);

    printQNumPyArray(AA);
    // printQNumPyArray(BB);

    const float real_multiplier = (scale_A*scale_B)/scale_C;
    int32_t quantized_multiplier;
    int right_shift;
    QuantizeMultiplierSmallerThanOne(real_multiplier,&quantized_multiplier,&right_shift);

    QNumPyArray* CC = createQNumPyArray(C->shape[0],C->shape[1],C->shape[2],C->shape[3]);

    for (int i = 0; i < M; i++) {
        for (int j = 0; j < N; j++) {
            int32_t sum = 0;
            for (int k = 0; k < K; k++) {
                int indexA = getIndex(i, k, AA->shape[2], AA->shape[3], args.transA);
                int indexB = getIndex(k, j, BB->shape[2], BB->shape[3], args.transB);

                int a_val = static_cast<int>(AA->data[indexA] - zero_point_A);
                int b_val = static_cast<int>(BB->data[indexB] - zero_point_B);               

                sum += args.alpha * a_val * b_val; 
                
//                printf(" + [%d=]%d * [%d=]%d", indexA, A->data[indexA], indexB, B->data[indexB]);
                // sum += args.alpha * A->data[indexA] * B->data[indexB];
                // std::cout << "Init Sum : " << sum << std::endl;
//                sum += args.alpha * A->data[i * K + k] * B->data[k * N + j];
            }

            sum += bias->data[j];
            // std::cout << "After Bias Sum : " << sum << std::endl;
            // sum = MultiplyByQuantizedMultiplier(sum,quantized_multiplier,right_shift);
            sum = sum * real_multiplier;
            sum += static_cast<int>(zero_point_C);
            // std::cout << "After Quant Mul Sum : " << sum << std::endl;
            CC->data[i * N + j] = static_cast<int8_t>(sum + (args.beta * CC->data[i * N + j]));
            // std::cout << "Final Value : " << static_cast<int>(CC[i * N + j]) << std::endl;
//            printf("\nsum %d @ %d\n", sum, i * N + j);
//            printf("\n\\sum %d @ %d\n", C->data[i * N + j], i * N + j);

            // C->data[i * N + j]  = sum + args.beta * C->data[i * N + j];
        //    printf("\n--sum %d @ %d\n", C->data[i * N + j], i * N + j);
            // C->data[i * N + j] += bias->data[j];
        //    printf("\n//sum %d @ %d\n", C->data[i * N + j], i * N + j);
        }
    }

    Dequantize(scale_C,zero_point_C,CC,C);
}

void Gemm(DataPort *input0, DataPort *input1, DataPort *input2, DataPort *output0, gemm_args args) {
    ee_Gemm(input0->data, input1->data, input2->data, output0->data, { .alpha=args.alpha, .beta=args.beta, .transB=args.transB });
    return;
}

// Function to apply the ReLU activation
void ee_Relu(NumPyArray* input0, NumPyArray* output0)
{
    output0->shape[0] = input0->shape[0];
    output0->shape[1] = input0->shape[1];
    output0->shape[2] = input0->shape[2];
    output0->shape[3] = input0->shape[3];
    output0->size = input0->size;
    
    if (output0->data != nullptr)
        free(output0->data);
    output0->data = (int*)malloc(output0->size * sizeof(int));

    for (int i = 0; i < input0->size; i++) {
        output0->data[i] = input0->data[i] > 0 ? input0->data[i] : 0;
    }
}
void Relu(DataPort *input0, DataPort *output0) {
    ee_Relu(input0->data, output0->data);
    return;
}

