// Function to find the index of the maximum element in a 1D array
int argmax1D(NumPyArray *array) {
    int maxIndex = 0;
    
    for (int i = 1; i < array->size; i++) {
        if (array->data[i] > array->data[maxIndex]) {
            maxIndex = i;
        }
    }
    return maxIndex;
}

