// Model sequence
void *infer(void **input_data/*, callback */)
{
    input.data = createNumPyArray(1, 1, 28, 28, input_data[0]);

    std::cout << "Input Data : \n" << input.toString() << std::endl << std::endl;

    Flatten(&input, &_flatten_Flatten_output_0, { .axis = 1 });

   std::cout << "Flatten Output : \n" << _flatten_Flatten_output_0.toString() << std::endl << std::endl;

    Gemm(&_flatten_Flatten_output_0, &fc1_weight, &fc1_bias, &_fc1_Gemm_output_0, { .alpha = 1, .beta = 1, .transB = 1 });

   std::cout << "GEMM1 Output : \n" << _fc1_Gemm_output_0.toString() << std::endl << std::endl;

    Relu(&_fc1_Gemm_output_0, &_relu_Relu_output_0);

   std::cout << "Relu Output : \n" <<  _relu_Relu_output_0.toString() << std::endl << std::endl;

    Gemm(&_relu_Relu_output_0, &fc2_weight, &fc2_bias, &output, { .alpha = 1, .beta = 1, .transB = 1 });
    
    std::cout << "Final Output : \n" << output.toString() << std::endl;

    return output.data;
}

